import Todo from "./Todo"

function Todos ( props ) {
    let todos = props.todos
    console.log(todos);
    for(let i = 0; i < todos.length; i++) {
        console.log(todos[i]);
    }
    <div className="todos">
    {todos.map( (todo) => (
         <Todo todoText={todo.todoText}
            todoId={todo.todoId} />
    ))}
        </div>
}
